import React from 'react';
import { FormContainer, FormWrapper } from './FormElements';

const Form = () => {
  return (
    <>
      <FormContainer>
          <FormWrapper src="//embed.typeform.com/next/embed.js"
          data-tf-widget="UzH94V4N" 
          data-tf-inline-on-mobile 
          data-tf-medium="snippet" 
          ></FormWrapper>
      </FormContainer> 
    </>

  )
}

export default Form

